if mibBuilder.loadTexts: intSrvGuaranteedIfC.setDescription('The parameter C is the data backlog resulting from the vagaries of how a specific implementa- tion deviates from a strict bit-by-bit service. So, for instance, for packetized weighted fair queueing, C is set to the Maximum Packet Size. The error term C is measured in units of bytes. An individual element can advertise a C value between 1 and 2**28 (a little over 250 mega- bytes) and the total added over all elements can range as high as (2**32)-1. Should the sum of the different elements delay exceed (2**32)-1, the end-to-end error term should be (2**32)-1.')
